import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return(
        <ul>
            <li>Lern React</li>
            <li>Build Awesome App</li>
        </ul>
    );
};

ReactDOM.render(<TodoList />, document.querySelector('#root'));
